pragma solidity >0.4.23 <0.7.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./LoanCoin.sol";

contract Auction is Ownable {

  string public name;
  string public description;
  address payable public seller;
  uint256 public auctionPeriod;
  uint256 public auctionEnd;
  uint256 public loanAmount;
  uint256 public loanDuration;
  address public winningBidder;
  uint256 public winningInterestRate;
  bool public firstBid = true;

  mapping(address => uint256) public balanceOf;

  event WinningInterestRateChanged(address bidder, uint256 interestRate);
  event AuctionEnded(address winner, uint interestRate);
  event Transfer(address from, address to, uint256 amount);

  constructor(
      string memory _name,
      string memory _description,
      uint256 _loanAmount,
      uint256 _loanDuration,
      uint256 _auctionPeriod,
      address payable _seller
  )
      public
  {
      name = _name;
      description = _description;
      loanAmount = _loanAmount;
      loanDuration = _loanDuration;
      auctionPeriod = _auctionPeriod;
      auctionEnd = now + auctionPeriod;

      seller = msg.sender;
      transferOwnership(seller);
  }

  function withdraw() external {
    require(msg.sender != winningBidder, "winning bidder cannot withdraw");

    uint amount = balanceOf[msg.sender];
    balanceOf[msg.sender] = 0;
    msg.sender.transfer(amount);

    emit Transfer(address(this), msg.sender, amount);
  }

  function getMyBalance() external view returns(uint256) {
    return balanceOf[msg.sender];
  }

  function bid(uint256 interestRate) external payable {
    require(msg.value == loanAmount, "must transfer loanAmount");
    require(now < auctionEnd, "cannot bid after end of auction");
    require(balanceOf[msg.sender] == 0, "bidder must have withdrawn any previous bids");
    if (!firstBid) {
      require(interestRate < winningInterestRate, "bid must offer lower interest rate than current winning bid");
    }

    balanceOf[msg.sender] = msg.value;
    winningBidder = msg.sender;
    winningInterestRate = interestRate;

    if (firstBid) {
      firstBid = false;
    }

    emit WinningInterestRateChanged(msg.sender, interestRate);
  }

  function resolve() external {
    require(now >= auctionEnd, "cannot resolve until auction has ended");
    if (!firstBid) {
      balanceOf[seller] = balanceOf[winningBidder];
      balanceOf[winningBidder] = 0;

      /* LoanCoin loanCoin = new loanCoin(); */
    }

    emit AuctionEnded(winningBidder, winningInterestRate);
  }
}
